    onChange: (event: ChangeEvent<HTMLInputElement>) => void;
    onClick: () => void;
    value: string;
    data: any;
}

export function Weather({onChange, onClick, value, data}: IWeather) {
    console.log('ooo: ', data)
    return (
        <form className="weather__form">
            <input className="weather__input" type="search" value={value} onChange={onChange} />
            <button onClick={onClick} />
            {data && <Content data={data.data} />}
        </form>
    )
}
